svg.script:
var urls = {
 BORAT: ['BO Reudnitz-Anger-Crottendorf-Thonberg' ,'/partei/vor-ort/bo-rat/'],
 LINXXNET: ['linXXnet','/partei/vor-ort/linke-bueros/linxxnet/'],
 BRAUSTR: ['Geschftsstelle im Liebknecht-Haus','/partei/vor-ort/linke-bueros/geschaeftstelle-die-linke-leipzig/'],
 WEST: ['Stadtbezirksverband West','/partei/vor-ort/stadtbezirksverband-west/'],
 SODANN: ['Wahlkreis-Kulturbro','/partei/vor-ort/linke-bueros/wahlkreis-kulturbuero/'],
 INTERIM: ['INTERIM Wahlkreis- und Projektebro','/partei/vor-ort/linke-bueros/interim/'],
 GRUENAU: ['Wahlkreisbro Grnau','/partei/vor-ort/linke-bueros/wahlkreisbuero-gruenau/'],
 SUEDWEST: ['Stadtbezirksverband Sdwest','/partei/vor-ort/stadtbezirksverband-suedwest/'],
 SUEDOST: ['Stadtbezirksverband Sdost','/partei/vor-ort/stadtbezirksverband-suedost/'],
 SUED: ['Stadtbezirksverband Sd','/partei/vor-ort/stadtbezirksverband-sued/'],
 OST: ['Stadtbezirksverband Ost','/partei/vor-ort/stadtbezirksverband-ost/'],
 NORDWEST: ['Stadtbezirksverband Nordwest','/partei/vor-ort/stadtbezirksverband-nordwest/'],
 NORDOST: ['Stadtbezirksverband Nordost','/partei/vor-ort/stadtbezirksverband-nordost/'],
 NORD: ['Stadtbezirksverband Nord','/partei/vor-ort/stadtbezirksverband-nord/'],
 MITTE: ['Stadtbezirksverband Mitte','/partei/vor-ort/stadtbezirksverband-mitte/'],
 ALTWEST: ['Stadtbezirksverband Altwest','/partei/vor-ort/stadtbezirksverband-alt-west/'],
  RATHAUS: ['Fraktionsgeschftsstelle im Rathaus','/partei/vor-ort/linke-bueros/fraktionsgeschaeftsstelle-im-rathaus/']
},
textnode = document.getElementById('popup');

var totop = function(el) {
 if (el.tagName == "circle" || el.nextElementSibling.tagName == "circle") return;
 var limit = el.parentNode.getElementsByTagName("circle")[0];
 el.parentNode.insertBefore(el, limit);
},
mousein = function(ev) {
 var id = ev.target.id,
 text = urls[id][0];
 textnode.textContent = text;
 totop(ev.target);
},
mouseout = function(ev) {
 var id = ev.target.id,
 text = urls[id][0];
 if (textnode.textContent == text) {textnode.textContent = '';}
},
mousecklick = function(ev) {
  var id = ev.target.id,
  url = urls[id][1];
  window.open(url, '_parent');
};

for (var id in urls) {
   document.getElementById(id).addEventListener("mouseout", mouseout);
   document.getElementById(id).addEventListener("mouseenter", mousein);
   document.getElementById(id).addEventListener("click", mousecklick);
}
